    [],nt"revision_timestamp": "2016-07-27T22:56:03.286949",nt"name": "crab-orchard-national-wildlife-refuge-annual-narrative-report-calendar-year-1990",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crab Orchard
    National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    compliance with environmental and cultural resource mandates and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, safety, and technical assistance is given. Habitat
    management is also covered; subjects include wetlands, forests, croplands, grazing,
    haying, fire management, and pest control. The wildlife section of the report discusses
    endangered and threatened species, waterfowl, marsh birds and waterbirds, shorebirds,
    raptors, other migratory birds, game mammals, other resident wildlife, fisheries
    resources, and disease prevention and control. The public uses of the Refuge described
    in this report include outdoor classrooms, interpretive programs, hunting, fishing,
    trapping, wildlife observation, other wildlife oriented recreation, camping, picnicking,
    other non-wildlife oriented recreation, law enforcement, cooperative associations,
    and concessions. The equipment and facilities section of the report provides information
    about new construction, rehabilitation, major maintenance, equipment utilization
    and replacement, communications systems, computer systems, and energy conservation.
    Cooperative programs and items of interest are provided at the end. Photographs
    and refuge brochures are attached.",nt"license_title": "License Not Specified",nt"extras":
